Plot: &quot;Sex and the City&quot; is coming to the big screen in a feature film adaptation of the hit HBO television series. The film will follow the continuing adventures of the series four main characters - Carrie, Samantha, Charlotte and Miranda - as they live their lives in Manhattan four years after the series ended. Stars Sarah Jessica Parker, Kim Cattrall, Kristin Davis, and Cynthia Nixon are all on board to reprise their roles, while the film will be written and directed by Michael Patrick King, who executive produced the original television series. Additionally, Chris Noth, David Eigenberg, Evan Handler and Jason Lewis will return as the women&amp;#039;s love interests. Academy Award-winning actress Jennifer Hudson (&quot;Dreamgirls&quot; ) has also joined the cast of the film and will play Carrie Bradshaw&amp;#039;s assistant, a new character to be introduced in the film.

